import React from 'react'
import { StyleSheet, Text, View } from 'react-native'

const ImageDetail = ({title}) => {
    return (
        <View>
            <Text>
                {title}
            </Text>
        </View>
    )
}

export default ImageDetail
const styles = StyleSheet.create({})
